<style>
    #ireland svg path:hover {
        fill: #74664c !important;
    }

    #ireland svg path {
        cursor: pointer;
        transition: fill .2s linear;
    }

    :where(svg:not([fill])) {
        fill: currentColor;
    }

    .tooltip p {
        padding-bottom: 0;
        height: 30px;
    }

    div#ireland:hover .tooltip {
        display:block
    }

    .tooltip {
        display: none;
        cursor: default;
        position: absolute;
        padding: 8px 10px 10px;
        z-index: 20;
        border-radius: 5px 5px 5px 5px;
        box-shadow: 0 1px 4px 0 rgba(0, 0, 0, .3);
        border: 1px solid var(--white-color);
        width: 155px;
        background: white;
        /* background: linear-gradient(var(--tooltip-gradient-from), var(--tooltip-gradient-to)); */
        font-size: .9285714286em;
        pointer-events: none;
    }

    #tooltip_inner p input {
        width: 27px;
        text-align: center;
        padding: 0 1px 1px;
        color:rgb(0, 0, 0);
        float: right;
        border: none;
        margin-top: 0;
        margin-right: -5px;
        border-radius: 3px 3px 3px 3px;
        box-shadow: 0 1px 1px -1px #f9f6f6;
        text-shadow: 0 1px 0 #080808;
    }

    #tooltip_inner p input, #tooltip_inner p.t_week {
        font-size: 12px;
        font-family: var(--font-family-primary);
    }

    #tooltip_inner p.t_week {
        cursor: default;
        margin: -3px 0 0 -5px;
        padding: 4px;
        color: #6b6b6b;
        text-shadow: 0 1px 0 #f9f6f6;
    }

    #tooltip_inner p.t_dir {
        margin: 0 0 6px -5px;
        padding: 4px;
        color: #b79424;
        font-family: var(--font-family-primary);
        font-size: 12px;
        text-shadow: 0 1px 0 #fdfbfb;
    }

    #tooltip_inner p.t_dir input {
        background: var(--primary-600);
        cursor: default;
    }

    p#tip_header {
        color: #b79424;
    }
</style>
