<script>

    var countyData = <?= json_encode($dataArr) ?>;
    jQuery(document).ready(function() {
        // Get the container offset to calculate the relative position
        jQuery('#ireland').on('mousemove', function(event) {
            const containerOffset = jQuery(this).offset();
            const relativeX = event.pageX - containerOffset.left; // X relative to the container
            var relativeY = event.pageY - containerOffset.top;  // Y relative to the container
                relativeY = relativeY - 70;
            jQuery('.tooltip').css({
                left: relativeX + 'px',
                top: relativeY + 'px'
            });
        });
        
        jQuery('#ireland path').hover(function (e) {
            var county = jQuery(this).attr('county');
            jQuery('p#tip_header').text(county);
            console.log(countyData[county]);
            jQuery('input#week_val').val(countyData[county]['notice']);
            jQuery('input#dir_val').val(countyData[county]['service']);
        })

        jQuery('#ireland path').click(function (e) {
            var county = jQuery(this).attr('county');
            document.location.href = "<?= home_url( 'death-notices/?county=' ) ?>"+county;
        })

    });

</script>